    constructor(props) {
        super(props);
        this.state = {
            titre:`Bienvenue sur mon blog`
          }
    }
    componentDidMount=()=>{
        const titre = this.state.titre
        this.props.give(titre)
    }
    render() { 
        return ( 
            <>
            <div>
                <h2 className="text-center
                ">Mes passions</h2>
            </div>
            </>
         );
    }
}
 
